script: |
  super -f text -I q3567.spq | sort > q3567.out

inputs:
  - name: q3567.spq
    data: |
      SELECT + col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE + 83 / + col2 NOT IN ( col0 - - col1, - 29, + - col1 + + - col2 * col2 * + col2 );
  - name: tab2

outputs:
  - name: q3567.out
    data: |
      51
      67
      77
